User.create!([
  {username: "ligeti-splitz", email: "ligeti-splitz-123@hotmail.com", password_digest: "$2a$10$O7b95l51fct3ow5nG6a0a.QrrCEXFAWSTqMG60B34sl.n1aDYIsWS", session_token: "u614dO5Fu2K3HCz-X6G9jQ", digs_given: 0, digs_received: 0, about_me: "I was born in 1923 at Dicsőszentmárton, which was renamed Târnăveni in 1945, in Transylvania to a Hungarian Jewish family. I recalls that my first exposure to languages other than Hungarian came one day while listening to a conversation among the Romanian-speaking town police. Before that I hadn't known that other languages existed. I moved to Cluj (Kolozsvár) with my family              when aged six and I was not to return to the town of my birth until the 1990s."},
  {username: "bird", email: "bird-bird-bird@hotmail.com", password_digest: "$2a$10$kf4A7.eovB3Fnpvprcq5x.HonCLWnvyIjm5TqO4SJCFOPLGEnIjAG", session_token: "HEbS8gLfeH4t7UijCbJFdQ", digs_given: 0, digs_received: 0, about_me: "I. was born in Kansas City, Kansas, and raised in Kansas City, Missouri, the only child of Adelaide \"Addie\" (Bailey) and Charles Parker. I attended Lincoln High School in September 1934, but withdrew in December 1935, just before joining the local musicians' union."},
  {username: "gAgA", email: "lady-gaga-123@hotmail.com", password_digest: "$2a$10$I/OO.5iXLAE3ER2HDx9dsuolzz1yXKpP8MvVYJoLq19Gkpk6.0VMS", session_token: "wIQmpR1WWoHT9H-RMWYvBw", digs_given: 0, digs_received: 0, about_me: "I rose to prominence with mu debut album The Fame (2008), a critical and commercial success which produced global chart-topping singles such as \"Just Dance\" and \"Poker Face\". A follow-up EP, The Fame Monster (2009), was met with a similar reception and released the successful singles \"Bad Romance\", \"Telephone\", and \"Alejandro\"."},
  {username: "dragon", email: "dragon-dragon-123@hotmail.com", password_digest: "$2a$10$U8zMEaGFA4E.6Z62efnqTOjo0.Gt4Xbm0cRRzJhwQ9bkgPbTAlJyG", session_token: "Hev2JfJppYuarzEpVeMF7Q", digs_given: 0, digs_received: 0, about_me: "I have sold over 5 million albums worldwide. My     work has earned me a Grammy Award, three Juno Awards, six BET     Awards, and set several significant Billboard records. With     twelve number-one singles, I have more than any other artist     on Billboard's Hot Rap Songs chart. With ten number-one singles,     I also has more than any other rapper on Billboard‍ '​s Hot     R&B/Hip-Hop Songs chart, passing Jay-Z in August 2012. I am     one of two artists (the other being 50 Cent) that has     simultaneously occupied the chart's top three positions."},
  {username: "yorkshire_thomming", email: "yorkshire-thomming-123@hotmail.com", password_digest: "$2a$10$GAYekFkI7ra.MWAF9TUWjej0vbAcmBtd6QKiMM1iGYCCLCJLxg7ty", session_token: "QcXj9rxUVkLWTucYbuGKiA", digs_given: 0, digs_received: 0, about_me: "I received my first guitar when I was seven; my     earliest musical inspiration was guitarist Brian May of Queen.     At 10, I made my own guitar, inspired by May's Red Special.     By 11, I had joined my first band and written my first song.     In Oxford I attended the boys' public school Abingdon, where     I met Ed O'Brien, Phil Selway, and brothers Colin and Jonny     Greenwood and formed On a Friday, named for the only day we     were allowed to rehearse. I said: \"School was bearable for     me because the music department was separate from the rest     of the school. It had pianos in tiny booths, and I used to     spend a lot of time hanging around there after school.\"     After leaving school, I took a gap year, during which I worked     in a few jobs and was involved in a car accident that influenced     the lyrics of some of my songs including the Bends B-side     \"Killer Cars\" and \"Airbag\" from OK Computer."},
  {username: "ravi_ssss_123", email: "ravi-ssss-123@hotmail.com", password_digest: "$2a$10$VYgTQnmsJB3Dmywg99K3M.ImxaWEZZ0ol7euC/aCl8KgfZBunHPla", session_token: "hMw1C3SzUX6dSSkFk9me1w", digs_given: 20787, digs_received: 10000, about_me: "I was born to a Bengali family in Varanasi, India,     and spent my youth touring India and Europe with the dance     group of my brother Uday Shankar. I gave up dancing in 1938     to study sitar playing under court musician Allauddin Khan.     After finishing my studies in 1944, I worked as a composer,     creating the music for the Apu Trilogy by Satyajit Ray,     and was music director of All India Radio, New Delhi,     from 1949 to 1956."},
  {username: "bubbly_bublé", email: "bubbly-buble-123@hotmail.com", password_digest: "$2a$10$WOvt.Jm0XB2a5izx5QL3yuuhaB70CgFJN.yU0aQ7CT8b/fivfaRlG", session_token: "ASz8Dap92WAaWz-r852QsQ", digs_given: 524, digs_received: 0, about_me: "My first album reached the top ten in Canada and the UK. I found a worldwide audience with my 2005 album It's Time, and my 2007 album Call Me Irresponsible which reached number one on the Canadian Albums Chart, the UK Albums Chart, the U.S. Billboard 200 albums chart, the Australian ARIA Albums Chart and several European charts."},
  {username: "the_king", email: "the-king-123@hotmail.com", password_digest: "$2a$10$mh3WjepyjE6oRuusZ1sB9uSTqS7CRNLD.oOyvVkxFHqzppAEWZvyG", session_token: "wd5tjtoJKxZ3BfW9odkrgw", digs_given: 0, digs_received: 0, about_me: "I was born on January 8, 1935, in Tupelo, Mississippi,     the son of Gladys Love and Vernon Elvis Presley in the two-room     shotgun house built by Vernon's father in preparation for     the child's birth. Jesse Garon Presley, my identical twin     brother, was delivered stillborn 35 minutes before him.     As an only child, I became close to both parents and formed     an especially close bond with his mother. My family attended     an Assembly of God church, where I found my initial musical     inspiration."},
  {username: "-(s_s)-", email: "sufjan-stevens-123@hotmail.com", password_digest: "$2a$10$3UMiV9WE6Ea3DAEgWwvonedpxfqVWvXNQzIw39btqIwpmrphVfAh2", session_token: "1NDMxi1cCRtfBR50yHOUXg", digs_given: 0, digs_received: 0, about_me: "I have released albums of varying styles, from the     electronica of Enjoy Your Rabbit and the lo-fi folk of Seven     Swans to the symphonic instrumentation of Illinois and     Christmas-themed Songs for Christmas. I make use of a variety     of instruments, often playing many of them myself on the same     recording, and write music in various time signatures.     Though I have repeatedly stated an intent to separate my beliefs     from my music, I also freely draw from the Bible and Christian     tradition."},
  {username: "sarah_vonVaughan", email: "sarah-sarah_vonVaughan-123@hotmail.com", password_digest: "$2a$10$N2I6qU7VwIHyWY0SdJgmwOBIL5TaoJje2QCva2C/qCC/rmpFA1F2G", session_token: "fWck1CUr6H_prv98JqN0oA", digs_given: 1000, digs_received: 5000, about_me: "My father, Asbury \"Jake\" Vaughan, was a carpenter by trade and played guitar and piano. My mother, Ada Vaughan, was a laundress and sang in the church choir. They had migrated to Newark from Virginia during the First World War. I was their only biological child, although in the 1960s they adopted Donna, the child of a woman who traveled on the road with me."},
  {username: "lead_zeppelin", email: "lead-zeppelin-123@hotmail.com", password_digest: "$2a$10$8dfLs9P20PDSSa9lZ5wWWewTnlxcrJf9Cxgy/tH1/r0FPy3Q8jKxK", session_token: "O2WR9uJYO-za6MSYWX12CQ", digs_given: 2000, digs_received: 6000, about_me: "We are widely considered one of the most successful,     innovative, and influential rock groups in history. We are     one of the best-selling music artists in the history of audio     recording; various sources estimate our record sales at 200     to 300 million units worldwide. With RIAA-certified sales of     111.5 million units, we are the second-best-selling band in     the United States. Each of our nine studio albums placed in      the top 10 of the Billboard album chart and six reached the      number-one spot. Rolling Stone magazine described us as      \"the heaviest band of all time\", \"the biggest band of the       '70s\",[4] and \"unquestionably one of the most enduring       bands in rock history\". We were inducted into the Rock and       Roll Hall of Fame in 1995; the museum's biography of the       band states that they were \"as influential\" during the       1970s as the Beatles were during the 1960s."},
  {username: "ludwig_vanB_123", email: "ludwig-vanB-123@hotmail.com", password_digest: "$2a$10$Zf5HjNOMPFTmONKglyEj..BgWOwAwG1hq767CG05f2mOsKoO0lW5.", session_token: "qeNU3_Hr1L86R1GbpXGRIQ", digs_given: 400, digs_received: 100, about_me: "Born in Bonn, then the capital of the         Electorate of Cologne and part of the Holy Roman Empire,         I displayed my musical talents at an early age and was         taught by me father Johann van Beethoven and by Christian         Gottlob Neefe. During my first 22 years in Bonn, I intended         to study with Wolfgang Amadeus Mozart and befriended Joseph Haydn.         I moved to Vienna in 1792 and began studying with Haydn,         quickly gaining a reputation as a virtuoso pianist. I         lived in Vienna until my death. In about 1800, my hearing         began to deteriorate, and by the last decade of my life, I was almost totally deaf.         I gave up conducting and performing in public but         continued to compose; many of my most admired works come from this period."}
